var userConnection = Get<UserConnection>("UserConnection");
var currentId = Get<Guid>("currentId");
var calendarId = Get<Guid>("calendarId");
var calendarTimeZone = Get<string>("CalendarTimeZone");
var userTimeZone = Get<string>("UserTimeZone");
var startDate = Get<DateTime>("StartDateFirstWork");
var endDate = Get<DateTime>("EndDate");
var pause = Get<string>("PauseMin");
TimeSpan sum;
pause = pause.Replace("д. ", ".");

var CaseESQ = new EntitySchemaQuery(userConnection.EntitySchemaManager,	"Case");
CaseESQ.AddAllSchemaColumns();
CaseESQ.Filters.Add(CaseESQ.CreateFilterWithParameters( FilterComparisonType.Equal, "Id", currentId));
var CaseEC = CaseESQ.GetEntityCollection(userConnection);
foreach(var entity in CaseEC){
	if (endDate > startDate)
	{	
		var tsRessult = UsrTimePeriodServise.GetRessult(startDate, endDate, calendarId, calendarTimeZone, userTimeZone, userConnection);
			if (pause!=String.Empty){
				if (TimeSpan.TryParse(pause, out sum)){
					tsRessult = tsRessult + sum;
				}
			}
		string res = String.Format("{0:0}д. {1:00}:{2:00}:{3:00}", tsRessult.Days, tsRessult.Hours, tsRessult.Minutes, tsRessult.Seconds);
		int ttl = tsRessult.Days * 24 * 60 + tsRessult.Hours * 60 + tsRessult.Minutes;
		Set("ResultTime", res);
		Set("TTLMinutes", ttl);
	}
	else if(endDate == startDate)
	{
		Set("ResultTime", "0.00:00:00");
		Set("TTLMinutes", 0);
	}
}
return true;
